INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("青空の下で謁見", 2, 8, 91002, "ペコリーヌとの出会い", "フリーマーケット会場", 20063115, 7, 5118061, 1, 0, 40, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("未来の騎空団\nマスコット？", 2, 8, 91002, "マホとの出会い", "フリーマーケット会場", 20063115, 7, 5118062, 1, 0, 40, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("お嬢さまからの\n緊急依頼", 2, 8, 91002, "アキノとの出会い", "ランドソル市街地", 20063115, 7, 5118063, 1, 0, 40, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("黄金色の悩みごと", 2, 8, 91002, "ジュンとの出会い", "フリーマーケット会場", 20063115, 18, 5118064, 1, 0, 40, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("白熱！　格闘大会！", 2, 8, 91002, "カオリとの出会い", "フリーマーケット会場", 20063115, 18, 5118065, 1, 0, 40, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("祭り太鼓はオーエドの華", 2, 8, 91002, "ニノンとの出会い", "オーエド町", 20063115, 16, 5118066, 1, 1, 40, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("人気者は遅れて\nやってくる", 3, 8, 91002, "スズナとの出会い", "フリーマーケット会場", 20063115, 19, 5118067, 1, 0, 40, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("巫女・ミーツ・魔法少女", 3, 8, 91002, "ナナカとの出会い", "ランドソル市街地", 20063115, 18, 5118068, 1, 0, 40, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("ネズ耳は二度なくなる", 3, 8, 91002, "キャル＆コッコロとの出会い", "フリーマーケット会場", 20063115, 18, 5118069, 1, 0, 40, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("この出会いにカンパイ！", 3, 8, 91002, "ユカリとの出会い", "ランドソル市街地", 20063115, 18, 5118070, 1, 0, 40, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("陰陽アンサンブル", 3, 8, 91002, "アオイとの出会い", "ランドソル市街地", 20063115, 18, 5118071, 1, 0, 40, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("運試し十番勝負！", 3, 8, 91002, "シノブとの出会い", "フリーマーケット会場", 20063115, 7, 5118072, 1, 1, 40, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES ("彼女たちの新たな日常", 1, 0, 0, "オープニング", 0, 20063115, 0, 5118600, 0, 0, 0, 0, 0, 10118);
